import React from 'react'
import StatList from './StatList'
import CustomSelect from './UI/select/customSelect'
import { STATS } from '../values/stats.js'

function StatViewer() {
    const stats = [
        {name: 'Название1', value: 0},
        {name: 'Название2', value: 0},
        {name: 'Название3', value: 0},
        {name: 'Название4', value: 0},
        {name: 'Название5', value: 0},
    ]
    const options = STATS.map(s => Object.create( null, {   // объект-прототип соответствует null
      value: {                   // добавляем новое свойство
        value: s['name']
      },
      label: {
        value: s['name']
      }
    }))

  return (
    <div className='StatViewer'>
        <CustomSelect options={options}/>
        <StatList stats={stats}/>
    </div>
  )
}

export default StatViewer
